import React, { useState } from "react";

function Contral_kayboard() {
    const [display, setdisplay] = useState(false);
    const [expanded, setExpanded] = useState(false);

    const handleToggle = () => {
        setdisplay(!display);
        setExpanded(!expanded);
    };

    return (
        <div className="contral_kayboard">
            <div className="detiles" style={{ height: expanded ? 'auto' : '59px' }}>
                <button className="test" onClick={handleToggle}>click</button>
                <div className="data" style={{ display: display ? 'block' : 'none' }}>

                </div>
            </div>
        </div>
    )
}
export default Contral_kayboard;
